import React, { Component } from "react";
import { Link, Route, BrowserRouter as Router } from "react-router-dom";
export default class Body extends Component {
  constructor() {
    super();
    this.state = {
      listOfLinksWebSite: ["WebSiteInfo", "Credentials", "Status"]
    };
  }
  render() {
    return (
      <div className="container-fluid text-center">
        <div className="row content">
          <div className="col-sm-2 sidenav">
            {this.props.routeState.map(route => {
              if (route.path === this.props.pathName) {
                route.navBar.map(item => {
                  this.setState({
                    listOfLinks: this.state.listOfLinks.concat([item])
                  });
                });
              }
            })}
          </div>

          <div className="col-sm-8 text-left">
            <h1>Welcome</h1>

            {this.props.routeState.map(route => {
              if (route.path === this.props.pathName) {
                return route.path;
              }
            })}

            <hr />
            <h3>Test</h3>
            <p>Lorem ipsum...</p>
          </div>
        </div>
      </div>
    );
  }
}
